import { BrowserRouter, Routes, Route } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import Home from "./pages/Home";
import Admin from "./pages/Login/Admin";
import Patient from "./pages/Login/Patient";
import Doctor from "./pages/Login/Doctor";
import Patientx from "./pages/Register/Patientx";
import Doctorx from "./pages/Register/Doctorx";
import Patientprofile from "./pa";
import Doctorprofile from "./pages/Myprofile/Doctor";
import { createContext, useState } from "react";
import View1 from "./pages/Report/MydoctorReports";
import View2 from "./pages/Report/MypatientReports";


export const Appcontext = createContext();

function App() {
  const [mail, setMail] = useState("MyProfile");
  const [user, setUser] = useState("admin");
  const [doctorid, setDoctorid] = useState("MyId");
  const [patientid, setPatientid] = useState("MyId");
  return (
    <div>
      <Appcontext.Provider
        value={{
          user,
          setUser,
          mail,
          setMail,
          doctorid,
          setDoctorid,
          patientid,
          setPatientid,
        }}
      >
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/login-admin" element={<Admin />} />
            <Route path="/login-patient" element={<Patient />} />
            <Route path="/login-doctor" element={<Doctor />} />
            <Route path="/signup-patient" element={<Patientx />} />
            <Route path="/signup-doctor" element={<Doctorx />} />
            <Route path="/patientProfile" element={<Patientprofile />} />
            <Route path="/doctorProfile" element={<Doctorprofile />} />
            <Route path="/view1" element={<View1 />} />
            <Route path="/view2" element={<View2 />} />
          </Routes>
        </BrowserRouter>
      </Appcontext.Provider>
    </div>
  );
}

export default App;
